import './Blast.css'
import axios from 'axios'
import { useForm } from 'react-hook-form'
import {useEffect, useState} from 'react'
import {type} from '@testing-library/user-event/dist/type'

const Blast = () => {

const {register, handleSubmit} = useForm()
const [databases, getDatabases] = useState()

const getMany = () => {
	axios.get(`http://192.168.1.37:8080/db/blast-db`).then(res => { getDatabases(res.data.map(entry => { 
		return <option key={entry._id} value={entry.name}>{entry.title}</option> })) })
}

useEffect(getMany, [])



	return (
		<div className='Blast'>
			<form onSubmit={ handleSubmit(data => console.log(data)) }>
				<select {...register("type") }>
					<option value="blastn">blastn</option>
					<option value="blastp">blastp</option>
					<option value="blastx">blastx</option>
					<option value="tblastn">tblastn</option>	
					<option value="tblastx">tblastx</option>
				</select>
				<input {...register("query") } type="text" id='QuerySubject'/>
				<input {...register("file") } type="file" id='Subject' multiple/>
				<select {...register("db") } >
					<option defaultValue="select a Database"/>
					{ databases }
				</select>
				<input type="submit"/>
			</form>
		</div>
	)
}

export default Blast
